import React from 'react';
import './Home.css';
import About from './About';
import Intro from './Intro';
import Projects from './Projects';
import Animation from './Animation';
import Waypoint from 'react-waypoint';
import { CSSTransition } from 'react-transition-group';

const isAnimation = false;
const _showAnimation = () =>{
    console.log("in _showAnimation()");
}
const Home = (props) =>{
    return(
        <div className="Home">
            <Intro />
            <About />
            <Projects />
            <Waypoint
                onEnter={_showAnimation()}
                bottomOffset='0%'
            >
                <div>
                    <CSSTransition
                        in={isAnimation}
                        timeout={0}
                        classNames="Anim-home"
                        unmountOnExit
                    >
                        <Animation />
                    </CSSTransition>
                </div>
            </Waypoint>


        </div>
    );
}
export default Home;
